// src/components/Home.js
import React from "react";
import styled from "styled-components";

const Container = styled.div`
  text-align: center;
  height: 719px;
  background-image: url("/images/Home_bg.jpg");
  background-size: cover;
`;

const Home = () => {
  return <Container></Container>;
};

export default Home;
